INSERT INTO `comments` VALUES (392,5,5,'','',0,0,0,377,'','<p>Thank you for your comment, Chelsey. I firmly believe we all met more Daves than we think. As people during burnout usually leave the organization, we often don&#39;t even realize that some of our colleagues went through this experience. I agree with you that most companies are not ready to deal with this and any other &quot;mental issues&quot; like depression, anxiety, addictions, self-sabotage, etc. It is still taboo, somewhere out there, but we don&#39;t like to admit it&#39;s just next to us. That it affects our employee, colleague, boss, neighbor... We are not ashamed to call sick when we break our leg or have a severe infection, but when our mind, heart, soul, and often also our body suffers, we are ashamed. I think it is because often we believe it is our fault, that something is wrong with us, and because we are not sure if we can be helped. </p><p>I believe we need to and can destigmatize burnout. We can cure it.</p>','','77.74.100.209',1,'',0,1,0,0,0,0,0,0,0,'2021-04-11 00:57:31','2021-04-11 00:57:31'),(378,3,4,'','',0,0,0,0,'','<p>It is interesting how in many situations each of us can feel truly valued and appreciated...until we perceive a lack of fairness, and then suddenly that sense of value is shattered; whether the difference between ourselves and the person who is being treated &#39;more fairly&#39; is justified or not, in many cases it is challenging to shake off emotions and look at the situation rationally. We&#39;re starting to see a growing number of countries being required to publish the gender pay gap - Switzerland&#39;s audited results will be available to employees in 2021 - which will lead to increased transparency, hopefully encouraging companies to more openly share how they make decisions on reward and readdress any inequalities accordingly.</p>','','51.154.10.120',1,'',0,1,0,1,0,0,0,0,0,'2021-03-31 22:02:54','2021-03-31 22:02:54'),(384,5,3,'','',0,0,0,376,'','<p>Very true, Chelsey, I see &quot;the owners&quot; still too often. I believe that if, as parents, we see our role as nurturing and guiding &quot;our&quot; children to become the greatest selves they can and are meant to be, it changes the way we think, feel and act. When we accept they are not here to follow us, satisfy our needs, nor test us, we realize the privilege and responsibility we have to help them discover the world around them and the world inside them: their hearts, their potential, their purpose.</p><p>I think it is a privilege as it&#39;s a gift not all people have a chance to experience. It can add a whole new dimension to our lives and, often, help find the purpose we could not formulate before. </p><p>And if our parents failed, wholly or occasionally, in guiding us to discover our own worth, it is easier to come to peace with ourselves, knowing our thoughts and souls are not from them. We are free to fly forth.</p>','','77.74.100.209',1,'This user posted as the admin.',1,1,0,0,0,0,0,0,0,'2021-04-02 15:54:13','2021-04-02 15:54:13'),(377,3,5,'','',0,0,0,0,'','<p>Wow Lucyna! I think we&#39;ve all met a Dave or two in our time and while there are some organisations that genuinely do care about mental health and have the right people, policies and programmes in place, most companies, in my view, still feel unsure and ill-equipped when it comes to handling such sensitive, taboo topics. I can only hope that as the western world continues to shine a light on these issues, the itch for organisations becomes too big to ignore.</p>','','51.154.10.120',1,'',0,1,0,1,0,0,0,0,0,'2021-03-31 21:47:08','2021-03-31 21:47:08'),(376,3,3,'','',0,0,0,0,'','<p>This is a beautiful concept! Though I don&#39;t have children, on a frequent basis I see and hear this &#39;ownership&#39; when people talk about their children; I never thought much of it, but looking at it as &#39;a journey&#39; really shifts the perspective on my own upbringing and how I myself would like to parent.</p>','','51.154.10.120',1,'',0,1,0,1,0,0,0,0,0,'2021-03-31 21:31:25','2021-03-31 21:31:25'),(390,8,4,'','',0,0,0,378,'','<p>It is a thought-provoking comment, Chelsey!</p><p>This kind of a sudden realization or perception that we are not treated equitably AFTER we felt valued &amp; appreciated, as you mention, can cause even more damage. If we believed other people, or in this case: our boss regards what we do and how we are, a realization that, i.e., I receive a pat on my back, but others for similar achievement or efforts are rewarded with a bonus, makes us question whether the initial recognition (praise or gratitude) were genuine in a first place. It leaves a very bitter aftertaste.</p><p>It will be interesting to see the outcomes of the gender pay gap in Switzerland and even more fascinating employees&#39; and employers&#39; reactions. Who will take the lead? Who will bury their head in the sand? Who will pretend it is not their issue? Who will stand by and watch? As usual: we all have a role to play. Let&#39;s chose them consciously.</p>','','77.74.100.209',1,'',0,1,0,0,0,0,0,0,0,'2021-04-11 00:26:55','2021-04-11 00:26:55');
/*!40000 ALTER TABLE `comments` ENABLE KEYS */;
